import React, { Component } from 'react'
import { connect } from 'react-redux'
import { withStyles } from '@material-ui/core/styles'
import { compose } from 'redux'
import Popover from '@material-ui/core/Popover'
import Selector from './Selector'
import selectors from '../data/selectors'

const sectionA = "\n"

const styles = {
  imgContainer: {
    width: 800,
    height: 600,
    backgroundImage: `url(data:image/png;base64,${sectionA})`
  },
  selectorsContainer: {
    position: 'relative',
    width: 800,
    height: 600,
  },
  popover: {
    pointerEvents: 'none',
  },
}

class Concept extends Component {
  
  render() {
    
    const { classes } = this.props;
    
    return (
      <div>
        <header>
          <h2>Title</h2>
          <h3>Subtitle</h3>
        </header>
        <div className={classes.imgContainer}>
          <div className={classes.selectorsContainer}>
            {selectors.map((el, index) => {
              return <Selector
                key={index}
                id={el.id}
                left={el.left}
                top={el.top}
                width={el.width}
                height={el.height}
              />
            })}
          </div>
        </div>
        <Popover
          open={this.props.isPopperOpen}
          className={classes.popover}
          anchorEl={this.props.popperAnchorEl}
          anchorOrigin={{
            vertical: 'bottom',
            horizontal: 'center'
          }}
          transformOrigin={{
            vertical: 'top',
            horizontal: 'center'
          }}
        >
          <p>Info for part {this.props.currentPart}</p>
        </Popover>
      
      </div>
    )
  }
}

function mapStateToProps(state) {
  return {
    isPopperOpen: state.isPopperOpen,
    popperAnchorEl: state.popperAnchorEl,
    currentPart: state.currentPart
  }
}

export default compose(connect(mapStateToProps), withStyles(styles))(Concept)
